import React, { useContext } from 'react';
import AuthContext from './context/AuthContext';
import Login from './components/Login';
import Home from './components/Home';

function App() {
  const {auth} = useContext(AuthContext);
  return (
    <main>
      {auth ? <Home/> : <Login/>}
    </main>
  );
}

export default App;
